import React from 'react';
import { ImageComponent } from 'components';
import { Profile, ImageContainer, Section, Span, InformationContainer, Wrapper } from './styled';
const Component = ({ userData: { firstName, lastName, phoneNumber, email, img } }) => {
    return (
        <Wrapper>
            <Profile>
                <ImageContainer>
                    <ImageComponent src={img} />
                </ImageContainer>
                <InformationContainer>
                    <Section><Span>Nombre: </Span> {firstName}</Section>
                    <Section><Span>Apellido: </Span>{lastName}</Section>
                    <Section><Span>Tel√©fono: </Span>{phoneNumber}</Section>
                    <Section><Span>Email: </Span>{email}</Section>
                </InformationContainer>
            </Profile>
        </Wrapper>
    );
}

export default Component;
export { Component as Profile }
